return (
    <div>
        {/* <FaBars /> */}
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <Link to="/store">Store</Link>
        <Link to='/calender'>Events</Link>
        <button onClick={<Link to="/cart"></Link>}>My Cart</button>
    </div>
)


}

export default Navbar;
